    e.prevenDefault();
  };

  return (
    <div>
      <form onSubmit={handleSubmit}>
        <h3>Sign up</h3>
        <input type="text" placeholder="Name" value={userSignUp.name} onChange={handleChange}/>
        <br />
        <input type="text" placeholder="Email"  value={userSignUp.email} onChange={handleChange} />
        <br />
